import 'isomorphic-fetch'


const Simple = ({repos}) => {

    Simple.getInitialProps = async () => {

        const response = await fetch("https://api.github.com/orgs/rocketseat/repos")
     
        const repos = await response.json()
     
        console.log(repos)
     
        return {repos}
     }




    return (
        <div>




{

    repos.map(repo => {
        <h1 key={repo.id}>{repo.name}</h1>
    }) 
}





</div>
    )
}


export default Simple
